import React from "react";
import GetShipment from "./Queries/GetShipment";

const Shipment = () => {
    const { error, data, loading } = GetShipment(1);

    useEffect(() => {
      console.log(loading);
    }, [loading]);

    if (loading) {
      return <p>Loading...</p>;
    }
    return (
      <div>
        {data.user.shipments &&
          data.user.shipments.map((shipment, key) => (
            <p key={key}>{shipment.id}</p>
          ))}
      </div>
    );
};

export default Shipment;
